import React, {Component} from 'react'
import PropTypes from 'pro'



class Profesion extends Component{
    render(){
           const {job} = this.props

        return(
            <div>
                {job}
            </div>
        )
    }
}
Profesion.defaultProps = {job: "programmer"}
Profesion.propTypes = {job: PropTypes.string}

export default Profesion
